People List: Starter App
Build an Express app to display a list of people, each with their own page containing more information about them. This will help illustrate the need for templates, because it will become increasingly tedious to create a page for each individual person.
Getting Started

Open up a terminal, create a new folder for the People List project, and cd into it
Run npm init, taking all of the defaults other than setting app.js for the entry point
Install Express with npm install express --save
Create a new file in the People List project folder named home.html
Fill out the home.html file with a header, a paragraph, and an empty list
Create a new file in the People List project folder named app.js

A Basic Express Server
Open up the app.js file, and add the code for a simple web server.

Import the express and path modules, storing them in const variables
Create const variables for the hostname (127.0.0.1) and port (3000)
Initialize the by calling express() and storing the result in a variable named app
Define a new function named homePage with two parameters: request and response
In the body of the homePage function, use response.sendFile to send home.html
Use path.join to get the absolute path for home.html


Use app.get to specify that requests to the root ('/') should call the homePage callback
Define a function named listenCallback, and in the body, log the hostname and port
Finally, use app.listen to listen on the proper port and hostname, and pass listenCallback as the callback
Run the app with node app.js, and navigate to http://127.0.0.1:3000 to make sure it is running!

Code
const express = require('express');
const path = require('path');

const hostname = '127.0.0.1';
const port = 3000;

let app = express();

function homePage(request, response) {
    response.sendFile(path.join(__dirname, 'home.html'));
}

app.get('/', homePage);

function listenCallback() {
    console.log(`Listening on http://${hostname}:${port}`);
}

app.listen(port, hostname, listenCallback);

Creating a Person Page
The people for this website should come from the people.json file. Right click the people.json link to download it into the same directory as the app.js file. Note the data that appears for each person: First Name, Last Name, Avatar (image), Job, and Alive (boolean). The Person page should have a representation for all of this information.

Create a new file in the People List project folder named people0.html
Fill out the people0.html file with the HTML provided below
Note that this person is the first in the people.json array


In the app.js file, define a new function named personPage with two parameters: request and response
In the body of the personPage function, use response.sendFile to send person0.html
Use path.join to get the absolute path for person0.html


Use app.get to specify that requests to the /person endpoint should call the personPage callback
In the home.html file, add an li to the list, and link to this person page
The text should be the person's name
The href attribute should be /person



