                background: mediumseagreen;
            }



        Person Information
        Name: Dorisa Wonfar
        Occupation: Media Manager I




Run the server to make sure the page for Dorisa loads properly!
Adding Multiple People with a Query Parameter
One person is good, but the app would be much better if it could show multiple people. However, it would be ideal if all of these different people could be surfaced from the same endpoint (/person). It is possible to change the person information based on a query parameter!

Create a new file in the People List project folder named person1.html
Copy the HTML code from person0.html into person1.html
Update person1.html so that it properly represents the second person from the people.json array
The background color should be red because Tammy is dead ☹


At the top of the app.js file, import the url module, and store it in a const const url = require('url');


In the body of the personPage function, obtain the value of a query parameter index and store it in a variable: let parsedUrl = url.parse(request.url, true);
 let index = Number(parsedUrl.query.index);


Create an if statement to check if index is 0 or NaN
If it is, the server should respond to the request by sending person0.html


Use an else if to check if index is 1
If it is, the server should respond to the request by sending person1.html


In the home.html file, add a link to this second person by setting the href to /person?index=1
Run the server to make sure each link works properly!

Code
const express = require('express');
const path = require('path');
const url = require('url');

const hostname = '127.0.0.1';
const port = 3000;

let app = express();

function homePage(request, response) {
    response.sendFile(path.join(__dirname, 'home.html'));
}

function personPage(request, response) {
    let personFile;
    let parsedUrl = url.parse(request.url, true);
    let index = Number(parsedUrl.query.index);

    if (index == 0 || isNaN(index)) {
        personFile = 'person0.html';
    } else if (index == 1) {
        personFile = 'person1.html';
    }

    let personPath = path.join(__dirname, personFile);
    response.sendFile(personPath);
}

app.get('/', homePage);
app.get('/person', personPage);

function listenCallback() {
    console.log(`Listening on http://${hostname}:${port}`);
}

app.listen(port, hostname, listenCallback);

Adding More People
When this part is working, add another HTML page for the third person in the people.json array. Make sure to properly route to this new person's page based on the query parameter in the personPage function, and add a link on the home.html page.

